import { Link } from "react-scroll";

const About = () => {
    return (
        <li className="nav-item">
            <Link
                activeClass="active"
                to="section2"
                spy={true}
                smooth={true}
                offset={-70}
                duration={1000}
            >
                About
              </Link>
        </li>
    )
};

const AboutSection = () => {
    <Section
          title="Services"
          subtitle="Sapphire Global Associates, LLC provides a growing list of services worldwide. Our member Associates takes an extraordinary and intimate approach on managing small scale projects to larger initiatives benefiting work industries, professional groups, individuals, local communities, educational institutions, government, and others. Our consultation work is based on astonishing completion of tasks, excellent work ethics with core values, and mindful to sustainable growth so our clients can benefit from the reignition of themselves or their companies.  "
          dark={true}
          id="section1"
        />
};

export default About;
